import { AsyncListComponent } from './async/async-list.component';
import { AsyncItemComponent } from './async/async-item.component';

@NgModule({
  declarations: [
    AppComponent,
    HelloComponent,
    ConfigComponent,
    UsersComponent,
    UserComponent,
    AsyncListComponent,
    AsyncItemComponent,
